INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2015-03-04 21:11:50', '2015-03-04 21:11:50', 'Dr. Salvatore Pisciotto has been serving the community of Glendale for almost 30 years now. Like his father before him, he is well liked and respected as an excellent physician. He practices in Glendale and Mineola with his brother, <a title="A. Joseph Pisciotto" href="http://localhost:8888/pisciotto_wordpress/?p=38">Dr. A. Jospeh Pisciotto</a>.', 'Salvatore A. Pisciotto, DO', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2015-05-11 21:10:07', '2015-05-11 21:10:07', '', 0, 'http://localhost:8888/pisciotto_wordpress/?p=1', 0, 'post', '', 0),
(2, 1, '2015-03-04 21:11:50', '2015-03-04 21:11:50', 'Our office has been a part of this community for over 45 years, starting in Ridgewood, under Dr. Salvatore F. Pisciotto. We have maintained a very family oriented atmosphere over these years. We are one of the very few offices that do not go by appointment, rather on a first come, first serve basis which seems to have worked successfully so far. Our community appreciates the dedication of being open 6 days a week as well as a 24 hour a day phone service. Many of our employees have worked with us for over 20 years or better helping to create that family oriented atmosphere.\r\n\r\nIn addition to being available 6 days per week, we offer specialist services such as Gastroenterology, Urology, Cardiology, Dopplers and sonograms to our patients by appointments.\r\n\r\n&nbsp;\r\n\r\nThis office is located along the side of Dr. Pisciotto''s home, where he has been serving the community for over 25 years. Family Practice takes on a very personal touch when located so close to home. Although an appointment is necessary, the office always makes room for any patient on a same day need. 24 hour phone service is also available.', 'About Us', '', 'publish', 'open', 'closed', '', 'sample-page', '', '', '2015-05-08 18:07:10', '2015-05-08 18:07:10', '', 0, 'http://localhost:8888/pisciotto_wordpress/?page_id=2', 0, 'page', '', 0),
(4, 1, '2015-03-06 15:59:38', '2015-03-06 15:59:38', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin'' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href="http://localhost:8888/pisciotto_wordpress/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'About Us', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2015-03-06 15:59:38', '2015-03-06 15:59:38', '', 2, 'http://localhost:8888/pisciotto_wordpress/?p=4', 0, 'revision', '', 0),
(5, 1, '2015-03-06 16:11:51', '2015-03-06 16:11:51', 'Our physicians have been serving the community for over thirty years.', 'Our Physicians', '', 'publish', 'open', 'open', '', 'our-physicians', '', '', '2015-03-06 16:11:51', '2015-03-06 16:11:51', '', 0, 'http://localhost:8888/pisciotto_wordpress/?page_id=5', 0, 'page', '', 0),
