(44, 1, '2015-03-06 18:48:04', '2015-03-06 18:48:04', 'Our office has been a part of this community for over 45 years, starting in Ridgewood, under Dr. Salvatore F. Pisciotto. We have maintained a very family oriented atmosphere over these years. We are one of the very few offices that do not go by appointment, rather on a first come, first serve basis which seems to have worked successfully so far. Our community appreciates the dedication of being open 6 days a week as well as a 24 hour a day phone service. Many of our employees have worked with us for over 20 years or better helping to create that family oriented atmosphere.', 'Glendale Office', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2015-03-06 18:48:04', '2015-03-06 18:48:04', '', 2, 'http://localhost:8888/pisciotto_wordpress/?p=44', 0, 'revision', '', 0),
